// src/components/CartReview.js

import React from 'react';

export default function CartReview({
  cart,
  handleRemove,
  handleBatchChange,
  handleAddBatch,
  handleSubmit,
  totalCTN,
  vehicleName,
  setVehicleName,
  vehicleNumber,
  setVehicleNumber,
  notes,
  setNotes
}) {
  return (
    <div className="max-w-4xl mx-auto space-y-4 px-4 pb-32">
      {cart.length === 0 ? (
        <p className="text-center text-gray-600">🛒 No items in cart.</p>
      ) : (
        cart.map((item, itemIndex) => (
          <div key={itemIndex} className="bg-white rounded-xl shadow-sm border border-blue-200 p-4">
            <div className="flex justify-between items-center mb-2">
              <h3 className="text-sm font-bold text-gray-800">{item.name}</h3>
              <button
                onClick={() => handleRemove(itemIndex)}
                className="text-red-500 hover:text-red-700 text-sm"
              >🗑️ Remove</button>
            </div>

            {item.entries.map((entry, batchIndex) => (
              <div key={batchIndex} className="flex flex-wrap gap-3 items-end mb-3 border p-2 rounded-md bg-gray-50">
                
                {/* Batch No */}
                <InputBlock label="Batch" value={entry.batch} onChange={(v) => handleBatchChange(itemIndex, batchIndex, 'batch', v)} />

                {/* MFG Date */}
                <InputBlock label="MFG" value={entry.mfg} onChange={(v) => handleBatchChange(itemIndex, batchIndex, 'mfg', v)} />

                {/* EXP Date */}
                <InputBlock label="EXP" value={entry.exp} onChange={(v) => handleBatchChange(itemIndex, batchIndex, 'exp', v)} />

                {/* Actual Qty */}
                <InputBlock label="Actual Qty" value={entry.actualQty} onChange={(v) => handleBatchChange(itemIndex, batchIndex, 'actualQty', v)} type="number" />

                {/* Rate */}
                <InputBlock label="Rate" value={entry.rate} onChange={(v) => handleBatchChange(itemIndex, batchIndex, 'rate', v)} type="number" />

                {/* Discount */}
                <InputBlock label="Disc %" value={entry.discount} onChange={(v) => handleBatchChange(itemIndex, batchIndex, 'discount', v)} type="number" />

                {/* Billed Qty (Auto-calculated) */}
                <div>
                  <label className="block text-xs text-gray-500 mb-1">Billed Qty</label>
                  <input
                    type="number"
                    value={entry.billedQty || 0}
                    disabled
                    className="border px-3 py-1 rounded w-24 bg-gray-100 text-gray-700 text-sm"
                  />
                </div>

              </div>
            ))}

            <button
              onClick={() => handleAddBatch(itemIndex)}
              className="text-blue-600 text-xs mt-2"
            >➕ Add Batch</button>

          </div>
        ))
      )}

      {cart.length > 0 && (
        <div className="bg-gray-100 border rounded-xl p-4 shadow-sm space-y-3 mt-6">

          {/* Vehicle Details */}
          <div className="flex gap-4 flex-wrap">
            <div className="flex-1 min-w-[150px]">
              <label className="block text-sm font-medium text-gray-600">🚛 Vehicle Name</label>
              <input
                type="text"
                value={vehicleName}
                onChange={(e) => setVehicleName(e.target.value)}
                className="border px-3 py-2 rounded w-full"
              />
            </div>

            <div className="flex-1 min-w-[150px]">
              <label className="block text-sm font-medium text-gray-600">🔢 Vehicle Number</label>
              <input
                type="text"
                value={vehicleNumber}
                onChange={(e) => setVehicleNumber(e.target.value)}
                className="border px-3 py-2 rounded w-full"
              />
            </div>
          </div>

          {/* Notes */}
          <div>
            <label className="block text-sm font-medium text-gray-600">📝 Notes</label>
            <textarea
              rows={3}
              value={notes}
              onChange={(e) => setNotes(e.target.value)}
              className="border px-3 py-2 rounded w-full"
            />
          </div>

          {/* Final Submit */}
          <div className="text-center">
            <button
              onClick={handleSubmit}
              className="bg-green-600 hover:bg-green-700 text-white font-semibold py-3 px-6 rounded-lg mt-3"
            >
              ✅ Final Review
            </button>
          </div>

        </div>
      )}
    </div>
  );
}

function InputBlock({ label, value, onChange, type = "text" }) {
  return (
    <div>
      <label className="block text-xs text-gray-500 mb-1">{label}</label>
      <input
        type={type}
        value={value || ""}
        onChange={(e) => onChange(e.target.value)}
        className="border px-3 py-1 rounded w-24 text-sm"
      />
    </div>
  );
}
